geregisseerd door Rich Cowan
met Ray Liotta, Ving Rhames en Christian Slater

Jack Verdon (Ray Liotta), rechercheur moordzaken, is bezig met het onderzoek naar een serie moorden. Wanneer hij de seriemoordenaar op het spoor komt, ontdekt FBI-agent Vuckovitch (Christian Slater) dat Jack met alle slachtoffers een band heeft. Hierdoor wordt Jack plots de hoofdverdachte in de zaak.

